func lengthOfLongestSubstring(s string) int {
	var m map[byte]int
	m = make(map[byte]int)
	maxLen := 0
	lastRepeatPos := -1
	for i := 0; i < len(s); i++ {
		if _, ok := m[s[i]]; ok && lastRepeatPos < m[s[i]] {
			lastRepeatPos = m[s[i]]
		}
		if i-lastRepeatPos > maxLen {
			maxLen = i - lastRepeatPos
		}
		m[s[i]] = i
	}
	return maxLen
}
